import React, {FC} from 'react';
import s from "./burgerMenu.module.css"
import NavLink from "../../shared/NavLink";

type BurgerProps = {
    isActiveHome: boolean
    isActiveAbout: boolean
    isActiveEducation: boolean
    isActiveSkills: boolean
    isActiveContacts: boolean
    activeHomeSetter: () => void
    activeAboutSetter: () => void
    activeEducationSetter: () => void
    activeSkillsSetter: () => void
    activeContactsSetter: () => void
}

const BurgerMenu: FC<BurgerProps> = (props) => {
    return (
        <nav className={s.burgerNav}>
            <NavLink title={"Home"} href={"#home"} isActive={props.isActiveHome} activeSetter={props.activeHomeSetter} size={"10rem"}/>
            <NavLink title={"About"} href={"#about"} isActive={props.isActiveAbout} activeSetter={props.activeAboutSetter} size={"10rem"}/>
            <NavLink title={"Educations"} href={"#education"} isActive={props.isActiveEducation}
                     activeSetter={props.activeEducationSetter} size={"10rem"}/>
            <NavLink title={"Skills"} href={"#skills"} isActive={props.isActiveSkills}
                     activeSetter={props.activeSkillsSetter} size={"10rem"}/>
            <NavLink title={"Contacts"} href={"#contacts"} isActive={props.isActiveContacts}
                     activeSetter={props.activeContactsSetter} size={"10rem"}/>
        </nav>
    );
};

export default BurgerMenu;
